  startDate!: Date;
  endDate!: Date;
  @ViewChild(MatPaginator) paginator!: MatPaginator;
  showFilters!:boolean;
  filteredData:any;
  dataSource = new MatTableDataSource<any>([]); // Asegúrate de que dataSource tenga datos  startDate!:string;
displayedColumns: string[] = ['id', 'fecha', 'ucid_call','duracion', 'agente', 'origen','destino','vdn','skill','reproducir'];
  selectedAudio: string | null = null; // URL del audio seleccionado
  AgentSelect:String[]=[];
  SkillSelect:String[]=[];
  selectedAgente: string = ''; 
  selectedSkill:string='';
  Origen!:string;
  Destino!:string;

  constructor() { }

  ngOnInit(): void {
    this.showFilters=false;
    this.AgentSelect=Array.from(new Set(this.data.map(entry => entry.agente)));
    this.SkillSelect=Array.from(new Set(this.data.map(entry => entry.skill)));

  }
  ngAfterViewInit(): void {
    this.dataSource.paginator = this.paginator; // Vincula el paginador a la tabla
    this.dataSource.data.length = 0; // Asignar la longitud de los datos a la tabla  
}
onAgenteChange(event: Event): void {
  this.selectedAgente = (event.target as HTMLSelectElement).value; // Actualizar la selección
}
onSkillSelect(event:Event):void{
  this.selectedSkill=(event.target as HTMLSelectElement).value
}

playAudio(audioUrl: string): void {
  if (!audioUrl) {
    console.warn('El elemento no tiene una ruta de audio válida.');
    return;
  }
  this.selectedAudio = audioUrl; // Asigna la URL del audio al reproductor
}
onSearch() {
  // Inicializar start y end antes de hacer la validación
  const start = this.startDate ? new Date(this.startDate) : null;
  const end = this.endDate ? new Date(this.endDate) : null;

  // Validar que start y end no sean null o undefined
  if (!start || !end) {
    console.warn('Fechas de inicio o fin inválidas.');
    return;
  }

  if (!this.showFilters) {
    this.filteredData = this.data.filter(item => {
      const itemStartDate = new Date(item.fecha);

      // Filtrar por rango de fechas
      const matchesDate =
        (!start || itemStartDate >= start) && (!end || itemStartDate <= end);

      return matchesDate;
    });
  } else {
    this.filteredData = this.data.filter(item => {
      const itemStartDate = new Date(item.fecha);

      // Filtrar por rango de fechas
      const matchesDate =
        (!start || itemStartDate >= start) && (!end || itemStartDate <= end);

      // Filtrar por agente
      const matchesAgente =
        this.selectedAgente && this.selectedAgente !== 'Ninguno'
          ? item.agente === this.selectedAgente
          : true;

      // Filtrar por skill
      const matchesSkill =
        this.selectedSkill && this.selectedSkill !== 'Ninguno'
          ? item.skill === this.selectedSkill
          : true;

      // Filtrar por origen (subcadena)
      const matchesOrigen =
        this.Origen && this.Origen !== ''
          ? item.origen.toLowerCase().includes(this.Origen.toLowerCase())
          : true;

      // Filtrar por destino (subcadena)
      const matchesDestino =
        this.Destino && this.Destino !== ''
          ? item.destino.toLowerCase().includes(this.Destino.toLowerCase())
          : true;

      return (
        matchesDate &&
        matchesAgente &&
        matchesSkill &&
        matchesOrigen &&
        matchesDestino
      );
    });
  }

  this.dataSource.data = this.filteredData; // Actualiza la tabla con los datos filtrados

  // Actualizar opciones únicas para AgentSelect y SkillSelect
  this.AgentSelect = Array.from(new Set(this.dataSource.data.map(entry => entry.agente)));
  this.SkillSelect = Array.from(new Set(this.dataSource.data.map(entry => entry.skill)));
  }

  Filter(){
    this.showFilters=!this.showFilters;
  }
